import React from "react";
import './client.css';
import client1 from '../images/cilent1.png'
import client2 from '../images/cilent2.png'
import client3 from '../images/cilent3.jpg'
import client4 from '../images/cilent4.png'
import client5 from '../images/cilent5.png'
import client6 from '../images/cilent6.png'



function Client() {
    return (
         <div>
            <h1>Our Clients</h1>
            <div>
                <img src={client1} className="clientlogo"/>
                <img src={client2}/>
                <img src={client3}/>
                <img src={client4}/>
                <img src={client5}/>
                <img src={client6}/>

            </div>
            
            
         </div>
    );
  }
  
  export default Client;
